import React from "react";

const Footer = () => {
  return (
    <div className="fixed bottom-0">
      <div>
        <p>2023 by Nitin Tundwal</p>
        <p>
          Powerd and secured by <span>Netlify</span>{" "}
        </p>
      </div>
      <div>
        <div>
          <h1>Call</h1>
          <p>9310289535</p>
        </div>
        <div>
          <h1>Gmail</h1>
          <p>nitintundwal07@gmail.com</p>
        </div>
        <div>
          <p>Follow</p>
          <div></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
